import React from "react";
import { useEffect, useState } from "react";

const AllStudents = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    async function Res() {
      const result = await fetch("http://localhost:5555/students");
      const res = await result.json();
      setData(res.data);
    }

    Res();
  });
  return (
    <div className="allstudents">
      <table className="table">
        <tr>
          <th>Sr. No.</th>
          <th>Student Name</th>
          <th>Year</th>
          <th>Branch</th>
          <th>Books Taken</th>
          <th> More Info / Edit / Delete</th>
        </tr>
        {data.map((ele, ind) => {
          return (
            <tr>
              <td>{ind + 1}</td>
              <td>{ele.studentName + ""}</td>
              <td>{ele.year}</td>
              <td>{ele.branch}</td>
              <td>05</td>
              <td className="tdbtn">
                <button className="btnblue">Info</button>
                <button className="btngreen">Edit</button>
                <button className="btnred">Delete</button>
              </td>
            </tr>
          );
        })}

        <tr>
          <td>02</td>
          <td>Kunal Titare</td>
          <td>04</td>
          <td>Mechanical</td>
          <td>05</td>
          <td className="tdbtn">
            <button className="btnblue">Info</button>
            <button className="btngreen">Edit</button>
            <button className="btnred">Delete</button>
          </td>
        </tr>
      </table>
    </div>
  );
};

export default AllStudents;
